import React, { Component } from 'react';

class Repo extends Component {

  render() {
    const {repo} = this.props;
    return (
      <li className="repo">
        <a href={repo.html_url}>
          {repo.name}
        </a> : {repo.description}
      </li>
    )
  }
}

export default Repo;
